import React, { Component } from 'react';
import { firebaseDatabase } from "./firebase";
import {LineChart} from 'react-easy-chart';


export default class DataGraph extends Component{


  render(){
    return(
    <div>
      <LineChart
    xType={'time'}
    axes
    interpolate={'cardinal'}
    width={750}
    height={250}
    data={[
      [
        { x: '1-Jan-15', y: 20 },
        { x: '1-Feb-15', y: 10 },
        { x: '1-Mar-15', y: 33 },
        { x: '1-Apr-15', y: 45 },
        { x: '1-May-15', y: 15 }
      ], [
        { x: '1-Jan-15', y: 10 },
        { x: '1-Feb-15', y: 15 },
        { x: '1-Mar-15', y: 13 },
        { x: '1-Apr-15', y: 15 },
        { x: '1-May-15', y: 10 }
      ]
    ]}
  />

   </div>
    )
  }
  }
